<script>
import gsap from "gsap";

export default {
    name: "HeroIlustration",

    mounted() {
        // Se agrega el listener del mouse al montar el componente
        window.addEventListener("mousemove", this.handleMouseMove);
        gsap.to("#RuedaUno", {
            rotation: 360,
            transformOrigin: "center center", // Esto hace que la rotación sea desde la esquina superior izquierda
            duration: 4,
            repeat: -1,
            yoyo: true,
        });
        gsap.to("#RuedaDos", {
            rotation: -360,
            transformOrigin: "center center", // Esto hace que la rotación sea desde la esquina superior izquierda
            duration: 4,
            repeat: -1,
            yoyo: true,
        });
        gsap.to("#RuedaDos", {
            rotation: -360,
            transformOrigin: "center center", // Esto hace que la rotación sea desde la esquina superior izquierda
            duration: 4,
            repeat: -1,
            yoyo: true,
        });
        gsap.to("#Globo", {
            rotation: 5,
            scale: 0.95, // Reduce el tamaño ligeramente
            duration: 8,
            transformOrigin: "right bottom", // Punto de anclaje en la esquina inferior derecha
            yoyo: true, // Hace que la animación vuelva a su estado original
            repeat: -1, // Animación infinita
            ease: "power1.inOut" // Efecto suave
        });
        gsap.to("#Avion", {
            rotation: -15,
            scale: 1.5, // Reduce el tamaño ligeramente
            duration: 4,
            transformOrigin: "right bottom", // Punto de anclaje en la esquina inferior derecha
            yoyo: true, // Hace que la animación vuelva a su estado original
            repeat: -1, // Animación infinita
            ease: "power1.inOut" // Efecto suave
        });

    },

    destroyed() {
        // Se elimina el listener del mouse cuando el componente se destruye
        window.removeEventListener("mousemove", this.handleMouseMove);
    },

    methods: {
        handleMouseMove(event) {
            const { clientX, clientY } = event;
            const xMove = (clientX / window.innerWidth - 0.5) * 20; // Movimiento en X (-10 a 10)
            const yMove = (clientY / window.innerHeight - 0.5) * 20; // Movimiento en Y (-10 a 10)
            const maxRotation = 2.5;
            const minRotation = -2.5;

            const limitedRotationL = Math.max(Math.min(yMove, maxRotation), minRotation); // Limita el valor de rotación para el brazo izquierdo
            const limitedRotationR = Math.max(Math.min(-yMove, maxRotation), minRotation);

            gsap.to("#Bombillo", {
                x: xMove,
                y: yMove,
                duration: 1,
                ease: "power2.out",
            });

            gsap.to("#BrazoL", {
                rotation: limitedRotationL,
                transformOrigin: "left top",
                duration: 0.1,
                ease: "power2.out",
            });
            gsap.to("#BrazoR", {
                rotation: limitedRotationR,
                transformOrigin: "right top",
                duration: 0.1,
                ease: "power2.out",
            });
        },
    },
};
</script>